const initState = {
    authError: null
}

const authReducer = (state = initState, action) => {
    switch (action.type) {
        case 'CREATE_COURSE':
            console.log('created course', action.course);
            return state;
        case 'LOGIN_ERROR':
            return {
                ...state,
                authError: 'Login failed'
            }
        default:
            return state;
    }
}

export default authReducer
